sys_variable_value.value:
(function execute(inputs, outputs) {

  	try { 
         var r = new sn_ws.RESTMessageV2('x_293046_fish_main.Mailjet Email', 'Send Email');
         r.setStringParameterNoEscape('message', gs.getProperty('vf.mailjet.message') );

         var toEmails = JSON.parse(gs.getProperty('vf.mailjet.to_email'));
         r.setStringParameterNoEscape('to_emails', JSON.stringify(toEmails));

         r.setStringParameterNoEscape('from_email', gs.getProperty('vf.mailjet.from_email'));

         var response = r.execute();
         var responseBody = response.getBody();
         var httpStatus = response.getStatusCode();

         outputs.result = responseBody;
    }
  catch(ex) {
    var message = ex.message;
    gs.error("VF: There was error sending email using Mailjet: " + message)
  }

})(inputs, outputs);

